question.query:
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX bio: <http://purl.org/vocab/bio/0.1/>
PREFIX mo: <http://purl.org/ontology/mo/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT DISTINCT ?band ?bandname
WHERE {
  ?band rdf:type mo:MusicGroup .
  ?band foaf:name ?bandname .
  ?band bio:event ?birthEvent .
  ?birthEvent rdf:type bio:Birth .
  { 
	?birthEvent bio:date ?date .
    	FILTER (?date <= '1924-12-31'^^xsd:date && ?date >= '1924-01-01'^^xsd:date) 
  }
  UNION 
  {
	?birthEvent bio:date ?date .
  	FILTER regex(?date,'1924') 
  }
}

PREFIX bio: <http://purl.org/vocab/bio/0.1/>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX mo: <http://purl.org/ontology/mo/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT DISTINCT ?artist ?name
WHERE {
  ?artist rdf:type mo:SoloMusicArtist .
  ?artist foaf:name ?name .
  ?artist bio:event ?event .
  ?event rdf:type bio:Birth .
  { 
	?event bio:date ?date .
    	FILTER (?date <= '1904-07-31'^^xsd:date && ?date >= '1904-07-01'^^xsd:date) 
  }
  UNION 
  { 
	?event bio:date ?date .
  	FILTER regex(?date,'1904-07') 
  }
}

queryInterpretation.sparqlQuery:
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> PREFIX dc: <http://purl.org/dc/elements/1.1/> PREFIX foaf: <http://xmlns.com/foaf/0.1/> PREFIX mo: <http://purl.org/ontology/mo/>
ASK { ?album (<http://purl.org/ontology/mo/release_type>) <http://purl.org/ontology/mo/album>.
?Bugs rdf:type <http://purl.org/ontology/mo/MusicArtist>. ?Bugs (rdfs:label|dc:title|foaf:name) "Bugs". ?album <http://xmlns.com/foaf/0.1/maker> ?Bugs. }

